
function ExportToPDF(doc) {

    //console.log(doc);
    var Title = $("#PrintTitle").val();

    var title2 = '<div  class="row printheader"><div dir="rtl" class="col-md-12"><div class="row"><div class="col-md-2  "><img id="logoImg" src="data:image/jpeg;base64," style="height:100px;width:100px;"></div></div><div class="row"><div class="col-md-3"><h5><strong>الإدارة العامة للموارد البشرية</strong></h5> </div><div class="col-md-6 text-center"><h3><strong> ' + $("#lblTitle").text() + '</strong></h3></div></div></div></div>';


    var HeaderStyle = 'font-size: 18px;font-weight: bold;text-align:center !important;background: #3598dc !important;'
    var tableBodyOdd = 'background: #f5f5f5;!important;';
    var tableBodyEven = '';
    var pageOrientation = $("#PaperLayout").val();
    var pageSize = doc.pageSize;
    var tables = doc.content[1].table.body;
    var table = '<table class="table  table-hover table-bordered">';
    for (var i = 0; i < tables.length; i++) {
        var d = tables[i];
        if (d[0].style == 'tableHeader') {
            table += '<thead>' + addRowPdf(d, 'th') + '</thead><tbody>';
        } else if (d[0].style == 'tableBodyOdd' || d[0].style == 'tableBodyEven') {

            table += addRowPdf(d, 'td');
        }
    }
    table += "</tbody></table>"

    var style = '<link href="AppPath/assets/global/plugins/bootstrap/css/bootstrap.min.css" rel="stylesheet" />';
    if (App.isRTL()) {
        style = '<link href="AppPath/assets/global/plugins/bootstrap/css/bootstrap-rtl.min.css" rel="stylesheet" />';
    }
    var printContents = '<html dir="rtl"><head><title></title><meta http-equiv="Content-Type" content="text/html; charset=utf-8" />' + style + '<style>.tableHeader{' + HeaderStyle + '} .tableBodyOdd{' + tableBodyOdd + '} .tableBodyEven{' + tableBodyEven + '}th {text-align: center !important;}</style></head><body><div style="font-size: 25px;" >' + title2 + '</div><br />' + table + '</body></html>';

    $('body').prepend("<form method='post' action='ws/ExportHandler.ashx' id='tempForm'><input type='hidden' name='data' value='" + printContents + "' ><input type='hidden' name='PageType' value='" + pageOrientation + "' ></form>");
    $('#tempForm').submit();
    $("tempForm").remove();
}

var addRowPdf = function (d, tag) {
    var str = '<tr class="' + d[0].style + '">';
    for (var z = 0, ien = d.length ; z < ien ; z++) {
        str += '<' + tag + '>' + d[z].text + '</' + tag + '>';
    }
    return str + '</tr>';
};
